  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Monomoy National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1962.
  The report begins by summarizing the weather conditions, water conditions, habitat
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, big game animals, furbearers, predators, rodents, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and Refuge participation. Items of interest and N-R forms are attached.\",\n\t\"owner_org\":
